import React, { useState } from 'react';

export default function ShareExercise() {

  const [subject, setSubject] = useState('');
  const [unit, setUnit] = useState('');
  const [year, setYear] = useState('');
  const [teacher, setTeacher] = useState('');
  const [school, setSchool] = useState('');
  const [description, setDescription] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault(); 
    const formData = { "subject":subject, "unit":unit, "year":year, "teacher":teacher, "school":school, "description":description };
    console.log('Form Data:', formData);
    setSubject('');
    setUnit("");
    setYear("");
    setTeacher("");
    setSchool("");
    setDescription("")
  };

  return (
    <div className='bg-white rounded-md m-20 mt-5'>
      <h1 className='text-xl text-bold p-7'>Upload a past paper</h1>
      <form onSubmit={handleSubmit} className='p-7' >
        <div className='text-base mb-5'>
          <label>Subject: </label>
          <input
            type="text"
            value={subject}
            onChange={(e) => setSubject(e.target.value)}
            required
          />
        </div>

        <div className='text-base mb-5'>
          <label>Unit:</label>
          <input
            type="text"
            value={unit}
            onChange={(e) => setUnit(e.target.value)}
            required
          />
        </div>

        <div className='text-base mb-5'>
          <label>Year:</label>
          <input
            type="text"
            value={year}
            onChange={(e) => setYear(e.target.value)}
            required
          />
        </div>

        <div className='text-base mb-5'>
          <label>Teacher:</label>
          <input
            type="text"
            value={teacher}
            onChange={(e) => setTeacher(e.target.value)}
          />
        </div>

        <div className='text-base mb-5'>
          <label>School:</label>
          <input
            type="text"
            value={school}
            onChange={(e) => setSchool(e.target.value)}
          />
        </div>

        <div className='text-base mb-5'>
          <label>Description:</label>
          <textarea
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            rows="2"
          />
        </div>

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}
